export default (function(a,b,c,d,e,f,g,h,i,j,k,l){return {data:{"4cWRTSoz4C":{data:{id:321,attributes:{imdbId:"tt0088814",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BYjU4MDNmMTYtYzUyNS00ZmRmLWFiYTMtNzdiYjE0NTdlZDI0XkEyXkFqcGdeQXVyNzY1NDgwNjQ@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"6.4\u002F10"},{Source:"Rotten Tomatoes",Value:"55%"},{Source:"Metacritic",Value:"59\u002F100"}],item_lang:{data:{id:984,attributes:{title:b,plot:"Centuries ago, in the land of Prydain, a young man named Taran is given the task of protecting Hen Wen, a magical oracular pig, who knows the location of the mystical black cauldron. This is not an easy task, for The Evil Horned King will stop at nothing to get the cauldron.",slug:"the-black-cauldron"}}},books:{data:[{id:3067,attributes:{title:b,description:f,thumbnail:g,authors:[a],firstBook:true,published:h,publisher:i,subtitle:e}},{id:3068,attributes:{title:b,description:f,thumbnail:g,authors:[a],firstBook:c,published:h,publisher:i,subtitle:e}},{id:3069,attributes:{title:j,description:k,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=UtrCoQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:c,published:l,publisher:"Square Fish",subtitle:d}},{id:3070,attributes:{title:j,description:k,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=jXqWBgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:c,published:l,publisher:"Henry Holt and Company (BYR)",subtitle:e}},{id:3071,attributes:{title:b,description:d,thumbnail:d,authors:[a],firstBook:c,published:"1985-10-01",publisher:"Dell Books",subtitle:d}}]}}},meta:{}}},prerenderedAt:1680940926060}}("Lloyd Alexander","The Black Cauldron",null,"","The Chronicles of Prydain","The peaceful land of Prydain is under threat. The evil Lord of Annuvin is using the dark magic of the Black Cauldron to create a terrifying army of deathless warriors. The Cauldron must be destroyed, and Taran joins Prince Gwydion and his faithful knights, Ellidyr and Adaon, in this perilous quest. Taran is desperate to wear his first sword and prove his worth amongst such noble men. But their adventure will demand great sacrifices, as each warrior fulfils his destiny in totally unexpected ways. The second book in Lloyd Alexander's classic fantasy epic The Chronicles of Prydain. \"Lloyd Alexander is the true High King of fantasy.\" - Garth Nix A Newbery Honour Book 1966","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=zJiWBQAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2014-11-01","Usborne Publishing Ltd","The Black Cauldron 50th Anniversary Edition","Henry Holt Books for Young Readers is proud to publish this 50th Anniversary Edition of Lloyd Alexander's classic Newbery Honor winner The Black Cauldron, the second book in the Chronicles of Prydain, with a new introduction by fellow Newbery Honor winner Rebecca Stead. In the land of Prydain, evil is never far away. Arawn, Lord of the Land of Death, has been building an army of dark warriors to take over Prydain, and the only way to stop him is to destroy the Black Cauldron he uses to create his dreaded soldiers. Taran the Assistant Pig-Keeper and his loyal companions must journey deep into Arawn's domain to destroy the Black Cauldron. For each of them, the quest has a special meaning. For Taran, it is the glorious opportunity to use his first sword in battle. But war requires a sacrifice greater than he'd ever imagined. . . .","2015-09-01"))